'use strict';$(function(){$("#city").autocomplete({serviceUrl:"https://nominatim.openstreetmap.org/search?format=json",paramName:"q",transformResult:function(a){a=JSON.parse(a);return{suggestions:$.map(a,function(b){return{value:b.display_name,data:{lat:b.lat,lon:b.lon}}})}},onSelect:function(a){$("#lat").val(a.data.lat);$("#lng").val(a.data.lon)}})});